import React from "react"

function DisplayItem(props) {
    console.log(this.props.item)
    return(

        <p>
        <label>
            <input type="checkbox" value={this.props.item}/>   
            {this.props.item}
        </label>
        <hr></hr>
        </p>
    )
}
export default DisplayItem
